import React from 'react'
import { loginRequest } from '../../AuthenticationFolder/authConfig'
import { callForEvent } from './GraphCalls';
import { useState } from 'react';
import { useEffect } from 'react';

export async function GetEvent (data, instance, accounts){

    const request = {
        ...loginRequest,
        account: accounts[0]
    };  
    instance.acquireTokenSilent(request).then((res) => token = res.accessToken);
    
    var token;


   return console.log(token.then)
}
